import React from 'react';

import './Summary.css';

const Summary = props => {
  return (
    <div className="summary">
      <h1>{props.name}</h1>
      <p>
        currency value: <span className="summary__output">{props.currencyValue}</span>
      </p>
      <p>
        Appears in # Movies:{' '}
        <span className="summary__output">{props.name}</span>
      </p>
    </div>
  );
};

export default Summary;
